Repulsor-Blastin' Extras: Bonus Disc, Containing The Non-Sex Version Of The Film!

From legendary director Axel Braun and adult powerhouse Vivid Entertainment comes an action-packed sexy spoof on the tale of billionaire philanthropist Tony Stark (Dale DaBone) and his super-hero alter-ego. When Stark is kidnapped and had to build a deadly weapon, he instead uses his intelligence to fabricate an indestructible armor and escape his captors. Once free, he must fight the evil Mandarin, save the world, and get laid. Not necessarily in that order! 

